{-# LANGUAGE OverloadedStrings #-}

module Seek (
  Seek (..),
  GameType (..),
  Color (..),
  Piece (..),
  PType (..),
  Square (..),
  Position (..),
  Row (..),
  Column (..),
  Move (..),
  CommandMessage (..),
  parseCommandMessage
) where


import Control.Applicative ((<*>), (*>), (<*), (<$>), (<|>), pure)
import Data.Char (chr)
import Data.Attoparsec.ByteString.Char8
import Data.List.Split (splitOn)
import Data.Maybe (isJust, fromJust)

import qualified Data.Attoparsec.ByteString.Char8 as A (take, takeWhile)
import qualified Data.ByteString.Char8 as B


data Color = Black | White deriving (Eq, Show)

data GameType = Untimed | Lightning | Blitz | Standard deriving (Show)

data Column = A | B | C | D | E | F | G | H deriving (Show, Enum)

data Row = One | Two | Three | Four | Five | Six | Seven | Eight deriving (Eq, Ord, Show, Enum, Bounded)

data PType = Pawn | Rook | Knight | Bishop | Queen | King deriving (Show)

data Piece = Piece PType Color deriving (Show)

data Square = Square Column Row deriving (Show)

type Position = [(Square, Piece)]

data Move = Move Position deriving (Show)

data Seek = Seek { id :: Int
                 , rating :: Int
                 , name :: String
                 , gameType :: GameType
                 , timeStart :: Int
                 , timeIncPerMove :: Int
                 , isRated :: Bool
                 , color :: Maybe Color
                 , ratingRange :: (Int, Int)
--                 , autoStart :: Bool
} deriving (Show)


data CommandMessage = CommandMessage { commandId :: Int
                                     , commandCode :: Int
                                     , message :: B.ByteString
                                     }
                      | PositionMessage {
                                         move :: Move
                                        }
                     | TextMessage {
                                    text :: B.ByteString
                                   } deriving (Show)



{-

<BLOCK_START><command identifier><BLOCK_SEPARATOR>

This will be followed by:

<command code><BLOCK_SEPARATOR><command output><BLOCK_END>

#define BLOCK_START 21 /* '\U' */
#define BLOCK_SEPARATOR 22 /* '\V' */
#define BLOCK_END 23 /* '\W' */
#define BLOCK_POSE_START 24 /* \X */
#define BLOCK_POSE_END 25 /* \Y */

-}

parseCommandMessage :: B.ByteString -> Result CommandMessage
parseCommandMessage str = parse parser str
                          where parser = choice [parseCommandMessage', parseMove]


parseCommandMessage' :: Parser CommandMessage
parseCommandMessage' = do
                        char $ chr 21
                        commandId <- decimal
                        char $ chr 22
                        commandCode <- decimal
                        char $ chr 22
                        message <- takeTill (== chr 23)
                        return $ CommandMessage commandId commandCode message


parseMove :: Parser CommandMessage
parseMove = do
              "<12>"
              space
              p <- A.take 71
              return $ PositionMessage $ Move (parsePosition $ B.unpack p)

parsePosition :: String -> [(Square, Piece)]
parsePosition str = fmap (\(s,p) -> (s, fromJust p)) $ filter (\(s,p) -> isJust p) squares
                where rows = parseRows str
                      squares = concat $ fmap parseSquares rows

parseRows :: String -> [(Row, String)]
parseRows str = zip rows lines
             where rows = reverse [One .. Eight]
                   lines = splitOn " " str

parseColumn :: String -> [(Column, Maybe Piece)]
parseColumn line = zip [A .. H] [readPiece c | c <- line]

parseSquares :: (Row, String) -> [(Square, Maybe Piece)]
parseSquares (r, line) = fmap (\cc -> ((Square (fst cc) r ), snd cc)) (parseColumn line)

readPiece :: Char -> Maybe Piece
readPiece 'P' = Just(Piece Pawn White)
readPiece 'R' = Just(Piece Rook White)
readPiece 'N' = Just(Piece Knight White)
readPiece 'B' = Just(Piece Bishop White)
readPiece 'Q' = Just(Piece Queen White)
readPiece 'K' = Just(Piece King White)
readPiece 'p' = Just(Piece Pawn Black)
readPiece 'r' = Just(Piece Rook Black)
readPiece 'n' = Just(Piece Knight Black)
readPiece 'b' = Just(Piece Bishop Black)
readPiece 'q' = Just(Piece Queen Black)
readPiece 'k' = Just(Piece King Black)
readPiece _ = Nothing


